import Button from "@mui/material/Button";
import styled from "styled-components";

const ButtonStyle = styled.div`
    margin: auto;
`

const ButtonForm = (props) => {
  return (
    <ButtonStyle>
      <Button
        variant="contained"
        style={{ width: "15%", margin: "auto" }}
      >
        {props.title}
      </Button>
    </ButtonStyle>
  );
};

export default ButtonForm;
